const personalContacts = ["your-personal-email@example.com"];

const jobRecommendationSources = {
  "glassdoor.com": true,
  "noreply@glassdoor.com": true,
  "linkedin.com": true,
  "inhire.io": true
};

const jobApplicationSources = {
  "indeedapply@indeed.com": true,
  "noreply@candidates.workablemail.com": true,
  "ats.rippling.com": true
};

// Keywords that indicate application confirmation, not just a recommendation
const applicationKeywords = [
  "application",
  "thanks for applying",
  "your application",
  "congratulations",
  "submitted"
];

const marketingDomains = [
  "uber.com",
  "glovoapp.com",
  "ubereats",
  "doordash",
  "grubhub",
  "notifications.graph.one",
  "noreply@"
];

const systemDomains = [
  "accounts.google.com",
  "no-reply@accounts.google.com"
];

const forumDomains = [
  "stackoverflow.com",
  "github.com",
  "reddit.com",
  "medium.com",
  "dev.to",
  "discord"
];

return items.map(item => {
  const email = item.json;
  const from = email.fromEmail?.toLowerCase() || "";
  const subject = email.subject?.toLowerCase() || "";
  const text = email.text?.toLowerCase() || "";

  let labelId = null;
  let labelName = null;
  let sendToAI = false;
  let confidence = 0;
  let reason = "";

  // ===== RULE 1: Personal Contacts (Highest Priority) =====
  if (personalContacts.includes(from)) {
    labelName = "CATEGORY_PERSONAL";
    confidence = 1.0;
    reason = "Matched personal contact";
  }

  // ===== RULE 2: System/Security Alerts =====
  else if (
    systemDomains.some(domain => from.includes(domain)) &&
    (subject.includes("security") || subject.includes("alert") || subject.includes("access"))
  ) {
    labelName = "SYSTEM_ALERT";
    confidence = 0.98;
    reason = "Security alert from Google";
  }

  // ===== RULE 3A: Job Recommendations (Glassdoor, LinkedIn, Inhire) =====
  else if (
    Object.keys(jobRecommendationSources).some(source => from.includes(source)) &&
    !applicationKeywords.some(kw => subject.includes(kw))
  ) {
    labelName = "JOB_RECOMMENDATIONS";
    confidence = 0.95;
    reason = "Job recommendations from platform";
  }

  // ===== RULE 3B: Job Applications (Indeed Apply, Workable, ATS) =====
  else if (
    Object.keys(jobApplicationSources).some(source => from.includes(source)) &&
    applicationKeywords.some(kw => subject.includes(kw))
  ) {
    labelName = "CATEGORY_UPDATES";
    confidence = 0.95;
    reason = "Application confirmation";
  }

  // ===== RULE 4: Marketing/Promotional =====
  else if (
    marketingDomains.some(domain => from.includes(domain)) ||
    (subject.includes("40% off") || subject.includes("save") || subject.includes("discount")) ||
    (subject.includes("order") && subject.includes("again"))
  ) {
    labelName = "CATEGORY_PROMOTIONS";
    confidence = 0.92;
    reason = "Marketing/promotional content";
  }

  // ===== RULE 5: Forums/Development =====
  else if (
    forumDomains.some(domain => from.includes(domain))
  ) {
    labelName = "CATEGORY_FORUMS";
    confidence = 0.90;
    reason = "Forum/developer community";
  }

  // ===== RULE 6: Newsletter/Digest (high confidence patterns) =====
  else if (
    (subject.includes("top picks") && subject.includes("week")) ||
    (subject.includes("digest")) ||
    (text.includes("unsubscribe") && text.length > 1500)
  ) {
    labelName = "CATEGORY_UPDATES";
    confidence = 0.85;
    reason = "Newsletter/digest content";
  }

  // ===== FALLBACK: Send to AI =====
  else {
    sendToAI = true;
    confidence = 0.0;
    reason = "Ambiguous - needs AI decision";
  }

  return {
    json: {
      ...email,
      labelName,
      labelId,
      sendToAI,
      confidence,
      reason
    }
  };
});

