return items.map(item => {
  const msg = item.json;
  const fromEmail = msg.from.value[0].address;
  let text = msg.text || "";

  // Extract URLs BEFORE cleaning text
  const urls = Array.from(text.matchAll(/https?:\/\/[^\s)]+/g), m => m[0]);

  // Filter out tracking/redirect URLs (keep only useful ones)
  const usefulUrls = urls.filter(url => {
    const urlLower = url.toLowerCase();
    // Remove obvious tracking/redirect patterns
    return !(
      urlLower.includes("track.") ||           // track.glovoapp.com, track.emailurl.com
      urlLower.includes("email.mgm.") ||       // email.mgm.uber.com
      urlLower.includes("d1a3f4spazzrp4.") ||  // CDN tracking pixels
      urlLower.match(/\/f\/a\/[a-zA-Z0-9~_-]+/) || // Generic tracking redirects
      urlLower.includes("cloudfront.net") ||   // AWS CloudFront tracking
      urlLower.includes("=") && url.length > 200 // Super long URLs with params
    );
  });

  // For Glassdoor: replace entire text
  if (fromEmail.includes("glassdoor.com")) {
    text = "[Job listing from Glassdoor]";
  }
  // For Very long texts (newsletters, marketing): aggressive cleanup
  else if (text.length > 800) {
    const lines = text
      .split(/\r?\n/)
      .map(l => l.trim())
      .filter(l => l && l.length > 5); // remove short/empty lines

    // Take first 1-2 meaningful lines (not just subject repeats)
    let summary = "";
    for (let i = 0; i < Math.min(2, lines.length); i++) {
      if (lines[i].length < 200) { // avoid huge lines
        summary += lines[i] + "\n";
      }
    }
    summary = summary.trim() || "[Long promotional email]";
    text = summary;
  }
  // For medium texts with many URLs: clean up
  else if (text.length > 300 && urls.length > 3) {
    const lines = text
      .split(/\r?\n/)
      .map(l => l.trim())
      .filter(l => l && !l.startsWith("http"));

    text = lines.slice(0, 3).join("\n") || "[Email content]";
  }

  // Normalize URLs: remove tracking params and shorten
  const cleanUrls = usefulUrls
    .slice(0, 2) // limit to 2 URLs max
    .map(u => {
      // Manual URL parsing (no URL constructor in n8n sandbox)
      const match = u.match(/https?:\/\/([^\/?#]+)(\/[^\?#]*)?/);
      if (match) {
        const domain = match[1];
        const path = match[2] || "";
        return `${domain}${path}`.substring(0, 80); // max 80 chars
      }
      return u.substring(0, 80);
    })
    .filter((u, i, arr) => arr.indexOf(u) === i); // deduplicate

  // Build final text
  let finalText = text;
  if (cleanUrls.length > 0) {
    finalText += "\n[" + cleanUrls.join(" | ") + "]";
  }

  return {
    json: {
      id: msg.id,
      date: msg.date,
      subject: msg.subject,
      fromName: msg.from.value[0].name,
      fromEmail: fromEmail,
      toEmail: msg.to.value[0].address,
      text: finalText,
      labels: msg.labelIds,
      urlCount: urls.length,
      usefulUrlCount: cleanUrls.length,
    }
  };
});
